import React  from 'react'
import CheckoutForm from "../components/CheckoutForm";

const Checkout: React.FunctionComponent = () => {
  return (
    <div className="bg-gradient-to-r from-white to-gray-500 h-screen w-screen flex flex-col">
      <div className="p-8 container max-w-lg mx-auto flex-1 flex flex-col items-center justify-center px-2">
        <div className="overflow-y-auto bg-white px-6 py-8 rounded-lg shadow-md text-black w-full">
          <h1 className="mb-8 text-3xl text-center text-gray-900">Checkout</h1>
            <CheckoutForm/>
        </div>
      </div>
    </div>
  )
}

export default Checkout
